@wonderwloki eu já me acostumei, mas todo dia é a MESMA COISA, parecem até que se reúnem em uma reunião e dizem: eae amados, de qual erro do Loki vamos falar hoje pra irritar uma Loki stan? 
– Vamos falar que ele matou 80 pessoas em dois dias e que causou o Ragnarok?
–BOA, PERFEITO

@Rakin Isso me lembra o caso do alec holowka,
 acusam ele sem provas concretas, perdeu tudo como o 4lan, depois disso ele se matou.
Se o suposto abusador não tiver mente forte vai ser mais um.
